import React from 'react';
import { Box, Typography } from '@mui/material';

const Header = () => (
    <Box
        sx={{
            position: 'fixed', // Keeps header at the top
            top: 0,
            left: 0,
            right: 0,
            bgcolor: '#333',
            color: '#fff',
            p: 2,
            zIndex: 10, // Ensures header stays above content
        }}
    >
        <Typography variant="h5">Huevos Express PR</Typography>
    </Box>
);

export default Header;
